templates['why'] = template({"compiler":[8,">= 4.3.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"container\">\n    <div class=\"section-header\">\n        <h2>WHY WE NEED</h2>\n        <h2>COMMUNITY THEATRE THRIVES</h2>\n    </div>\n    <div class=\"row justify-content-center\">\n        <div class=\"col-lg\">\n            <p>\n                The Washington, DC region is home to one of the most robust performing arts communities in the nation.\n                From Annapolis to Northern Virginia and everywhere in between, dozens of local community theatre groups\n                have thrived. These companies operate with the time and talents of thousands of volunteers to produce\n                hundreds of high-quality shows each year.\n            </p>\n            <p>\n                In addition to the much needed funds to keep these companies open, Community Theatre Thrives seeks to\n                raise awareness of the incredible passion, talent, generosity and dedication of the volunteers who make\n                community theatre here in the DMV possible. As COVID-19 has forced us all to adapt to a new reality of\n                social distancing, this unique event is bringing together nearly 20 local performing arts groups from\n                DC, Maryland and Virginia for a livestream telethon.\n            </p>\n            <p>\n                The performing arts are critical to the overall health of our society, especially in times of hardship.\n                Theatre in particular is vitally important as it transports us and sparks our imagination. It reminds us\n                of our potential, rekindles our sense of optimism, and brings to life stories that showcase our\n                resilience. Community theatre does all of this and more while striving to make performances affordable\n                and accessible to everyone.\n            </p>\n            <h4>\n                We need theatre in our communities, and right now, community theatre needs us.\n            </h4>\n        </div>\n    </div>\n</div>";
},"useData":true});
